import Layout from "../../layout";
import { Home } from "../../pages";
import { BrowserRouter, Route, Routes } from "react-router-dom";

export const Router = () => (
  <BrowserRouter>
    <Routes>
      <Route path="/" element={<Layout />}>
        <Route path="/" index element={<Home />} />
      </Route>
    </Routes>
  </BrowserRouter>
);
